site.headStyle:
img {
  max-width: 100%;
}

.post-date {
  margin: 10px;
  font-weight: bold;
  font-size: small;
  color: #D95B44;
  display: inline;
  line-height: 3;
}

.posts-list > article {
  border-radius: 2px;
  /* box-shadow: 0 2px 5px rgba(0, 0, 0, .15); */
  border-bottom: 1px solid rgba(0, 0, 0, .1);
  margin-bottom: 20px;
  padding-bottom: 10px;
}

.posts-list > article > a > div, .posts-list > article > a > em {
    margin: 10px;
}

blockquote {
    border-left: 1px solid gray;
    padding: 10px;
    margin: 10px;
}

.tags h2 {
    font-size: 15px;
    margin-top: 100px;
}

.tags ul {
    padding: 0;
}

.tags li a {
    text-decoration: none;
}

.tag {
    list-style: none;
    display: inline;
    border: 1px solid lightgray;
    padding: 5px;
}

@media only screen and (min-width: 481px),
only screen and (min-device-width: 481px) {
  .style-nav li {
    display: inline-block;
  }
}

.bg-shadow-top {
  -webkit-box-shadow: 0 0 6px rgba(0, 0, 0, .2);
  -moz-box-shadow: 0 0 6px rgba(0, 0, 0, .2);
  box-shadow: 0 0 6px rgba(0, 0, 0, .2);
}

.bg-shadow {
  -webkit-box-shadow: 0 6px 6px rgba(0, 0, 0, .2);
  -moz-box-shadow: 0 6px 6px rgba(0, 0, 0, .2);
  box-shadow: 0 6px 6px rgba(0, 0, 0, .2);
}

.static {
  text-align: center;
}

.static>.editable-style {
  vertical-align: top;
  display: inline-block;
  position: relative;
  top: 0;
  left: 0;
  margin: 0 20px;
  text-align: left;
}

.paged-element-hidden {
  display: none !important;
}

.max-height {
  max-height: 500px;
  overflow: auto;
}
